В каждой истории важна завязка 

И в нашем случае речь о деятельности органов студенческого самоуправления в образовательных организациях города Альметьевск. Работа съезда начинается с Ярмарки студенчества, где представлены студсоветы следующих образовательных организаций: 

 Альметьевский филиал УВО «Университет управления «ТИСБИ»; 
 Альметьевский торгово-экономического техникум;
 Альметьевский медицинский колледж;
 Альметьевский филиал КИУ имени В,Г. Тимирясова;
 Альметьевский филиал КНИТУ-КАИ; 
 Альметьевский государственный нефтяной институт;
 Альметьевский музыкальный колледжа им. Ф.З. Яруллина; 
 Альметьевский политехнический техникума; 
 Альметьевский колледж физической культуры; 
 Альметьевский политехнический техникум.

